import React, {useState}from 'react'

const Filter = ({ name, number }) => <div>{name} {number}</div>;



const Filters = ({ persons }) => {
  // console.log('Person name:', persons)
  return (
    <div>
      {persons.map(person => 
        <Filter key={person.name} name={person.name} number={person.number}/>)}
    </div>
  )
};

export default Filters;
